sys_variable_value.value:
(function execute(inputs, outputs) {


    var arr=(inputs.req).applications;
    //gs.info(arr);
    //gs.info(JSON.stringify(arr));
    var array=[]
    arr.forEach(function(rec){
        var obj={
            "id":rec.productId,
            "proposal":rec.applicationNos
        }
        array.push(obj);
    })
    outputs.list=array;
// ... code ...
})(inputs, outputs);

